/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `openId` varchar(255) DEFAULT NULL COMMENT '微信公众号关注者id',
  `name` varchar(255) DEFAULT NULL COMMENT '微信昵称',
  `header` varchar(255) DEFAULT NULL COMMENT '微信头像',
  `updateTime` int(11) DEFAULT NULL COMMENT '更新信息时间戳',
  `status` int(3) DEFAULT '1' COMMENT '关注状态。-1为取消关注，1为关注',
  PRIMARY KEY (`Id`),
  KEY `updateTime` (`updateTime`),
  KEY `openId_2` (`openId`),
  KEY `status` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=209 DEFAULT CHARSET=utf8;

